import React from 'react'
import Card from '../Components/Card';
import  ProjectComplete from "../Components/Assets/images/ProjectComplete.svg";


const Home=()=>{
    return (
        <div className='card'>
      <Card icon={ProjectComplete} status={"Project Completed"}/>
      <Card status={"Running Projects"}/>
      <Card status={"Pipeline Projects"}/>
      <Card status={"Support Required"}/>
    </div>
    );
}
export default Home;
